CREATE TABLE news (
  newsNo int(10) unsigned NOT NULL AUTO_INCREMENT,
  newsSubject varchar(255) NOT NULL,
  newsContent text NOT NULL,
  newsDate date NOT NULL,
  PRIMARY KEY (newsNo)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

