CREATE TABLE product (
  productNo int(10) unsigned NOT NULL AUTO_INCREMENT,
  productName varchar(255) NOT NULL,
  productAbstract text NOT NULL,
  productContent text NOT NULL,
  productPrice smallint(5) unsigned NOT NULL,
  productStock smallint(5) unsigned NOT NULL,
  productPicType varchar(255) NOT NULL,
  productPicBlob longblob NOT NULL,
  PRIMARY KEY (productNo)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

